import React from "react";
import { makeStyles, Box, Container, Grid, Link } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: "#03173e",
  },
  gridComp: theme.mixins.Grid,
}));
export default function Footer() {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <Box className={classes.gridComp}>
        <Container maxWidth="lg">
          <Grid container spacing={4}>
            <Grid item xs={12} sm={4}>
              <Box borderBottom={1} color="#fff">
                Help
              </Box>
              <Box>
                <Link href="https://hcahealthcaretoday.com/" color="###f">
                  Contact Us
                </Link>
              </Box>
            </Grid>
          </Grid>
        </Container>
      </Box>
    </div>
  );
}
